    false,nt"url": null,nt"notes": "National Earthquake Hazard Reduction Program
    (NEHRP) seismic site classes for Teton County, Idaho are contained in this shapefile.
    The intensity of ground shaking during an earthquake varies according to the nature
    of near-surface materials. NEHRP site classes quantify this effect and permit adjustment
    of expected ground motion. The site classes were determined in two ways. In the
    detailed study area containing populated parts of the county, i.e. the towns of
    Driggs, Victor, and Tetonia, 31 Vs30 measurements were made by Fugro Consultants
    Inc. using the IMASW technique (O'Connell and Turner, 2011). These measurements
    were interpolated within the detailed study area using geologic and geomorphic criteria
    to produce a map. The map contains six classes: C3 (760-620 m/s), C2 (620-490 m/s),
    C1 (490-360 m/s), D3 (360-300 m/s), D2, (300-240 m/s), and D1 (240-180 m/s). Vs30
    measurements ranged between 217 m/s and 734 m/s . Outside of the detailed study
    area, Vs30 was estimated using the U.S. Geological Survey's Global Vs30 Map Server
    (available at http://earthquake.usgs.gov/hazards/apps/vs30/). This technique uses
    topography as a proxy for Vs30. It produces a map with the same six classes as in
    the detailed study area. The two maps do not agree in many places along their boundaries.
    In areas with low relief, the Global Vs30 mapper method generally underestimates
    Vs30 compared to Vs30 measurements.",nt"license_title": null,nt"extras":
